            background-size: cover;
            background-position: center;
            filter: blur(8px) brightness(0.7);
            z-index: -2;
            transition: filter 0.5s ease;
        }
        body.timer-active::before { filter: blur(8px) brightness(1.1); }
        body::after {
            content: '';
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(135deg, rgba(139, 90, 43, 0.6) 0%, rgba(205, 133, 63, 0.5) 100%);
            z-index: -1;
            transition: background 0.5s ease;
        }
        body.timer-active::after { background: linear-gradient(135deg, rgba(139, 90, 43, 0.3) 0%, rgba(205, 133, 63, 0.3) 100%); }
        .control-buttons {
            position: fixed;
            bottom: 32px;
            left: 0;
            right: 0;
            display: flex;
            gap: 8px;
            justify-content: center;
            flex-wrap: nowrap;
            z-index: 20;
            padding: 0 10px;
        }
        .torah-quote {
            position: fixed;
            bottom: 8px;
            left: 0;
            right: 0;
            font-family: 'Frank Ruhl Libre', serif;
            font-size: 16px;
            color: black;
            text-shadow: 0 0 10px white, 0 0 20px white;
            opacity: 0.85;
            text-align: center;
            z-index: 10;
            white-space: nowrap;
        }
        .container {
            text-align: center;
            max-width: 100%;
            width: 100%;
            position: relative;
            z-index: 1;
            padding-bottom: 90px;
        }
        .page-title {
            font-size: 32px;
            font-weight: bold;
            color: white;
            margin-bottom: 30px;
            text-shadow: 0 3px 15px rgba(0,0,0,0.5);
            transition: all 0.5s ease;
            cursor: pointer;
        }
        .page-title.hidden { opacity: 0; transform: translateY(-20px); pointer-events: none; }
        .current-status-msg {
            font-weight: bold;
            color: #ef4444;
            margin-bottom: 10px;
            text-shadow: 0 3px 15px rgba(0,0,0,0.7);
            min-height: 40px;
            padding: 0 15px;
            animation: blink 1.5s ease-in-out infinite;
            transition: font-size 0.2s ease;
        }
        .current-status-msg.dairy {
            color: #3b82f6;
        }
        @keyframes blink {
            0%, 100% { opacity: 1; }
            50% { opacity: 0.3; }
        }
        .end-time-message {
            font-size: 24px;
            font-weight: bold;
            color: white;
            margin-bottom: 25px;
            text-shadow: 0 3px 15px rgba(0,0,0,0.5);
            min-height: 30px;
        }
        .buttons-container {
            display: flex;
            gap: 20px;
            justify-content: center;
            align-items: center;
            flex-wrap: wrap;
            margin-bottom: 20px;
        }
        .timer-button {
            width: 140px;
            height: 140px;
            border-radius: 50%;
            border: none;
            background: #D2B48C;
            box-shadow: 0 10px 35px rgba(0,0,0,0.4);
            font-size: 20px;
            font-weight: bold;
            color: #5D4037;
            cursor: pointer;
            transition: all 0.4s ease;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            gap: 6px;
        }
        .timer-button:active { transform: scale(0.95); }
        .timer-button.active {
            background: #4ade80;
            color: white;
            box-shadow: 0 10px 40px rgba(74, 222, 128, 0.5);
        }
        .icon { font-size: 56px; }
        .time-display {
            font-size: 48px;
            color: white;
            margin-top: 25px;
            margin-bottom: 50px;
            font-weight: bold;
            text-shadow: 0 3px 15px rgba(0,0,0,0.5);
            min-height: 60px;
            letter-spacing: 3px;
        }
        .status {
            font-size: 18px;
            color: white;
            margin-top: 15px;
            opacity: 0.95;
            min-height: 25px;
            text-shadow: 0 2px 10px rgba(0,0,0,0.5);
            transition: opacity 0.5s ease;
        }
        .status.fade-out { opacity: 0; }
        .permanent-status {
            font-size: 20px;
            color: white;
            margin-top: 15px;
            font-weight: bold;
            text-shadow: 0 2px 10px rgba(0,0,0,0.5);
            min-height: 25px;
            opacity: 0;
            transition: opacity 0.5s ease 3s;
        }
        .permanent-status.show { opacity: 1; }
        .completion-message {
            font-size: 28px;
            font-weight: bold;
            color: white;
            margin-top: 20px;
            text-shadow: 0 3px 15px rgba(0,0,0,0.5);
            min-height: 35px;
            opacity: 0;
            transition: opacity 0.5s ease;
            line-height: 1.5;
        }
        .completion-message.show { opacity: 1; }
        .control-buttons {
            margin-top: 25px;
            margin-bottom: 15px;
            display: flex;
            gap: 12px;
            justify-content: center;
            flex-wrap: wrap;
            padding: 0 15px;
        }
        .control-btn {
            padding: 10px 16px;
            border: none;
            border-radius: 25px;
            font-size: 14px;
            font-weight: bold;
            cursor: pointer;
            transition: all 0.3s ease;
            box-shadow: 0 5px 20px rgba(0,0,0,0.3);
            white-space: nowrap;
            flex: 1;
            max-width: 160px;
        }
        .control-btn:active { transform: scale(0.95); }
        .cancel-btn { background: rgba(239, 68, 68, 0.9); color: white; }
        .stop-beep-btn { background: rgba(251, 146, 60, 0.9); color: white; }
        .notification-btn { background: rgba(255, 255, 255, 0.9); color: #8B5A2B; }
        .modal {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0,0,0,0.8);
            justify-content: center;
            align-items: center;
            z-index: 1000;
            overflow-y: auto;
            padding: 20px;
        }
        .modal.show { display: flex; }
        .modal-content {
            background: white;
            padding: 30px;
            border-radius: 20px;
            max-width: 380px;
            width: 100%;
            text-align: center;
            max-height: 90vh;
            overflow-y: auto;
        }
        .modal-title { font-size: 24px; font-weight: bold; color: #8B5A2B; margin-bottom: 25px; }
        .settings-section { margin-bottom: 25px; text-align: right; }
        .section-title { font-size: 18px; font-weight: bold; color: #8B5A2B; margin-bottom: 15px; }
        .checkbox-options { display: flex; flex-direction: column; gap: 12px; margin-bottom: 15px; }
        .checkbox-option {
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 15px 18px;
            background: #f3f4f6;
            border-radius: 12px;
            cursor: pointer;
            transition: all 0.3s ease;
        }
        .checkbox-option:active { transform: scale(0.98); }
        .checkbox-option.checked { background: #4ade80; color: white; }
        .checkbox-label { display: flex; align-items: center; gap: 10px; font-size: 17px; font-weight: bold; }
        .checkbox-icon { font-size: 22px; }
        .custom-checkbox {
            width: 26px;
            height: 26px;
            border: 3px solid #8B5A2B;
            border-radius: 6px;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 0.3s ease;
        }
        .checkbox-option.checked .custom-checkbox { background: white; border-color: white; }
        .custom-checkbox::after {
            content: '✓';
            font-size: 18px;
            font-weight: bold;
            color: #4ade80;
            opacity: 0;
            transition: opacity 0.3s ease;
        }
        .checkbox-option.checked .custom-checkbox::after { opacity: 1; }
        .volume-control {
            padding: 15px 18px;
            background: #f3f4f6;
            border-radius: 12px;
            margin-bottom: 12px;
        }
        .volume-label { font-size: 17px; font-weight: bold; color: #8B5A2B; margin-bottom: 10px; text-align: right; }
        .volume-slider {
            width: 100%;
            height: 8px;
            border-radius: 5px;
            background: #d1d5db;
            outline: none;
            -webkit-appearance: none;
        }
        .volume-slider::-webkit-slider-thumb {
            -webkit-appearance: none;
            width: 24px;
            height: 24px;
            border-radius: 50%;
            background: #8B5A2B;
            cursor: pointer;
        }
        .volume-value { text-align: center; margin-top: 8px; font-size: 16px; font-weight: bold; color: #8B5A2B; }
        .time-selector {
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 15px 18px;
            background: #f3f4f6;
            border-radius: 12px;
            margin-bottom: 12px;
        }
        .time-selector-label { font-size: 17px; font-weight: bold; color: #8B5A2B; }
        .time-controls { display: flex; align-items: center; gap: 12px; }
        .time-btn {
            width: 36px;
            height: 36px;
            border-radius: 50%;
            border: none;
            background: #8B5A2B;
            color: white;
            font-size: 20px;
            font-weight: bold;
            cursor: pointer;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 0.3s ease;
        }
        .time-btn:active { transform: scale(0.9); }
        .time-value { font-size: 19px; font-weight: bold; color: #8B5A2B; min-width: 70px; text-align: center; }
        .modal-close {
            padding: 14px 35px;
            background: #8B5A2B;
            color: white;
            border: none;
            border-radius: 25px;
            font-size: 17px;
            font-weight: bold;
            cursor: pointer;
            margin-top: 15px;
        }
        .modal-close:active { transform: scale(0.95); }
        .completion-msg-editor {
            background: #f3f4f6;
            border-radius: 12px;
            padding: 15px;
        }
        .completion-msg-preview {
            font-size: 22px;
            font-weight: bold;
            color: #3b82f6;
            text-align: center;
            margin-bottom: 12px;
            padding: 10px;
            background: white;
            border-radius: 8px;
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
        }
        .completion-msg-input-row {
            display: flex;
            gap: 8px;
            align-items: center;
        }
        .completion-msg-input {
            flex: 1;
            padding: 10px 14px;
            font-size: 16px;
            border: 2px solid #d1d5db;
            border-radius: 10px;
            text-align: right;
            direction: rtl;
            outline: none;
            font-family: inherit;
        }
        .completion-msg-input:focus {
            border-color: #8B5A2B;
        }
        .reset-msg-btn {
            width: 40px;
            height: 40px;
            border-radius: 50%;
            border: none;
            background: #8B5A2B;
            color: white;
            font-size: 20px;
            cursor: pointer;
            display: flex;
            align-items: center;
            justify-content: center;
            flex-shrink: 0;
        }
        .reset-msg-btn:active { transform: scale(0.9); }
        .completion-msg-hint {
            font-size: 13px;
            color: #9ca3af;
            text-align: center;
            margin-top: 8px;
        }
        .install-prompt {
            position: fixed;
            bottom: 80px;
            left: 50%;
            transform: translateX(-50%);
            background: white;
            padding: 15px 25px;
            border-radius: 30px;
            box-shadow: 0 8px 30px rgba(0,0,0,0.4);
            display: none;
            align-items: center;
            gap: 15px;
            z-index: 2000;
        }
        .install-prompt.show { display: flex; }
    </style>
</head>
<body>
    <div class="container">
        <div id="pageTitle" class="page-title">מה אכלת?</div>
        <div id="currentStatusMsg" class="current-status-msg"></div>
        <div id="endTimeMessage" class="end-time-message"></div>
        
        <div class="buttons-container">
            <button class="timer-button meat" onclick="startTimer('meat')" style="display: none;">
                <div class="icon">🍗🥩</div>
                <div>בשר</div>
                <div id="meatHoursDisplay" style="font-size: 16px; opacity: 0.9;">5 שעות</div>
            </button>
            
            <button class="timer-button chicken" onclick="startTimer('chicken')">
                <div class="icon">🍗</div>
                <div>עוף</div>
                <div id="chickenHoursDisplay" style="font-size: 16px; opacity: 0.9;">5 שעות</div>
            </button>
            
            <button class="timer-button beef" onclick="startTimer('beef')">
                <div class="icon">🥩</div>
                <div>בקר</div>
                <div id="beefHoursDisplay" style="font-size: 16px; opacity: 0.9;">6 שעות</div>
            </button>
        </div>
        
        <div id="timeDisplay" class="time-display"></div>
        <div id="status" class="status"></div>
        <div id="permanentStatus" class="permanent-status"></div>
        <div id="completionMessage" class="completion-message"></div>
        
        <div class="control-buttons">
            <button id="cancelBtn" class="control-btn cancel-btn" onclick="cancelTimer()" style="display: none;">
                ביטול טיימר
            </button>
            <button id="stopBeepBtn" class="control-btn stop-beep-btn" onclick="stopBeeping()" style="display: none;">
                הפסק התראה
            </button>
            <button class="control-btn notification-btn" onclick="openNotificationSettings()">
                ⚙️ הגדרות
            </button>
        </div>
    </div>

    <div class="torah-quote">"לֹא תְבַשֵּׁל גְּדִי בַּחֲלֵב אִמּוֹ"</div>

    <!-- Hidden audio for PWA compatibility -->
    <audio id="nbaBuzzer" preload="auto">
        <source src="./nba-buzzer.wav" type="audio/wav">
    </audio>

    <div id="notificationModal" class="modal">
        <div class="modal-content">
            <div class="modal-title">הגדרות טיימר</div>
            
            <div class="settings-section">
                <div class="section-title">הודעת סיום</div>
                <div class="completion-msg-editor">
                    <div class="completion-msg-preview" id="completionMsgPreview">🎉 אתה חלבי ☕</div>
                    <div class="completion-msg-input-row">
                        <input 
                            type="text" 
                            id="completionMsgInput" 
                            class="completion-msg-input"
                            maxlength="20"
                            placeholder="🎉 מצבך חלבי ☕"
                            oninput="previewCompletionMsg(this.value)"
                            onchange="saveCompletionMsg(this.value)"
                        >
                        <button class="reset-msg-btn" onclick="resetCompletionMsg()">↺</button>
                    </div>
                    <div class="completion-msg-hint">עד 20 תווים • שורה אחת</div>
                </div>
            </div>
            
            <div class="settings-section">
                <div class="section-title">התראה בסיום הטיימר</div>
                <div class="checkbox-options">
                    <div class="checkbox-option" id="soundCheckbox" onclick="toggleNotification('sound')">
                        <div class="checkbox-label">
                            <span class="checkbox-icon">🔔</span>
                            <span>צלצול</span>
                        </div>
                        <div class="custom-checkbox"></div>
                    </div>
                </div>
                
                <div class="volume-control" id="volumeControl" style="display: none;">
                    <div class="volume-label">עוצמת צליל</div>
                    <input type="range" min="0" max="100" value="50" class="volume-slider" id="volumeSlider" oninput="adjustVolume(this.value)">
                    <div class="volume-value" id="volumeValue">50%</div>
                </div>
            </div>
            
            <div class="settings-section">
                <div class="section-title">סוג טיימר</div>
                <div class="checkbox-options">
                    <div class="checkbox-option" id="separateCheckbox" onclick="toggleNotification('separateTimes')">
                        <div class="checkbox-label">
                            <span class="checkbox-icon">🔀</span>
                            <span>זמן שונה לעוף ובקר</span>
                        </div>
                        <div class="custom-checkbox"></div>
                    </div>
                </div>
            </div>
            
            <div class="settings-section">
                <div class="section-title">משך זמן המתנה</div>
                
                <div class="time-selector" id="meatTimeSelector" style="display: flex;">
                    <span class="time-selector-label">🍗🥩 בשר</span>
                    <div class="time-controls">
                        <button class="time-btn" onclick="adjustTime('meat', -0.5)">−</button>
                        <span class="time-value" id="meatTime">5 שע׳</span>
                        <button class="time-btn" onclick="adjustTime('meat', 0.5)">+</button>
                    </div>
                </div>
                
                <div id="separateTimeSelectors" style="display: none;">
                    <div class="time-selector">
                        <span class="time-selector-label">🍗 עוף</span>
                        <div class="time-controls">
                            <button class="time-btn" onclick="adjustTime('chicken', -0.5)">−</button>
                            <span class="time-value" id="chickenTime">5 שע׳</span>
                            <button class="time-btn" onclick="adjustTime('chicken', 0.5)">+</button>
                        </div>
                    </div>
                    
                    <div class="time-selector">
                        <span class="time-selector-label">🥩 בקר</span>
                        <div class="time-controls">
                            <button class="time-btn" onclick="adjustTime('beef', -0.5)">−</button>
                            <span class="time-value" id="beefTime">6 שע׳</span>
                            <button class="time-btn" onclick="adjustTime('beef', 0.5)">+</button>
                        </div>
                    </div>
                </div>
            </div>
            
            <button class="modal-close" onclick="closeNotificationSettings()">סגור</button>
        </div>
    </div>

    <div id="installPrompt" class="install-prompt">
        <span style="font-size: 14px; font-weight: bold; color: #8B5A2B;">התקן למסך הבית</span>
        <button style="background: #8B5A2B; color: white; border: none; padding: 8px 20px; border-radius: 20px; font-size: 14px; font-weight: bold;" id="installBtn">התקן</button>
        <button style="background: none; border: none; font-size: 20px; color: #999;" onclick="closeInstallPrompt()">✕</button>
    </div>

    <script src="./app.js"></script>
    
    <!-- Mobile Debug Console - Remove in production -->
    <script src="https://cdn.jsdelivr.net/npm/eruda"></script>
    <script>
        // Show debug console only in debug mode
        if (localStorage.getItem('debugMode') === 'true') {
            eruda.init();
            console.log('🔍 Debug console enabled - swipe from right to open');
        }
    </script>
</body>
</html>
